Gross distribution from trusts action code: Enter the appropriate code that best describes the type of trust.  If the amount is from more than one type of trust, enter the code that represents the trust with the greatest amount of income. The codes are:
'039' - Cash management unit trust;
'059' - Deceased estate;
'071' - Discretionary trust - income from investment activities;
'072' - Discretionary trust - income from service and/or management services;
'077' - Discretionary trust - income from trading activities;
'089' - Fixed unit trust - other than a public trust described in P or Q;
'090' - Fixed trust - other than fixed trust or public trust;
'112' - Hybrid trust;
'179' - Public unit trust (listed) - other than a cash management unit trust;
'184' - Public unit trust (unlisted) - other than a cash management unit trust.
